import React from 'react';
import Link from 'next/link';

const HomePage = () => {
  return (
    <div>
    <Link href="/about">
      <a>About Page</a>
    </Link>
    <p>Hello Next.js</p>
      <p>HomePage</p>
    </div>
  );
};

export default HomePage;
